jQuery(document).ready(function(){"use strict";LELA_JS.init();LELA_Tab.event()});var LELA_JS={init:function(){LELA_Tab.init();LELA_ColorPicker.init()}};var LELA_ColorPicker={init:function(){var $colorPicker=jQuery(".lela-colorpicker");if($colorPicker.length>0){$colorPicker.wpColorPicker()}}};var LELA_Tab={init:function(){jQuery(".lela-tab.selected").each(function(){LELA_Tab.check(jQuery(this))})},event:function(){jQuery(document).on("click",".lela-tab",function(){LELA_Tab.check(jQuery(this))})},check:function(elem){var chosen_tab_name=elem.data("target");elem.siblings().removeClass("selected");elem.addClass("selected");elem.closest(".lela-inner").find(".lela-tab-content").removeClass("lela-tab-show").hide();elem.closest(".lela-inner").find(".lela-tab-content."+chosen_tab_name+"").addClass("lela-tab-show").show()}};